// Import necessary Cloudinary components
import { Cloudinary } from '@cloudinary/url-gen';
import { AdvancedVideo } from '@cloudinary/react';
import { fill } from '@cloudinary/url-gen/actions/resize';
import { AutoFocus } from '@cloudinary/url-gen/qualifiers/autoFocus';
import { FocusOn } from '@cloudinary/url-gen/qualifiers/focusOn';
import { autoGravity } from '@cloudinary/url-gen/qualifiers/gravity';

import './App.css';

// Initialize Cloudinary with your cloud name
const cld = new Cloudinary({
  cloud: {
    cloudName: 'dymsz1apj', // Replace with your Cloudinary cloud name
  },
});

// Pexels video URL
const pexelsVideoUrl = 'https://www.pexels.com/video/people-playing-soccer-6077718/';

function App() {
  return (
    <main className="main">
      <div className="container">
        <h1 className="title">Cloudinary React SDK AdvancedVideo Component</h1>
      </div>

      <div className="container">
        <h2>Pexels Video</h2>
        <p>Using a single video URL without referencing videos.json.</p>
        <ul className="videos">
          <li>
            <h3>Pexels Video</h3>
            <p>Aspect Ratio 16:9, auto gravity and auto focus on faces</p>
            <AdvancedVideo
              controls
              cldVid={
                cld.video(pexelsVideoUrl)
                  .resize(fill().width(400)
                    .aspectRatio("16:9")
                    .gravity(
                      autoGravity()
                        .autoFocus(AutoFocus.focusOn(FocusOn.face()))
                    )
                  )
                  .delivery("q_auto")
                  .format("auto")
              }
              autoPlay
              loop
            />
          </li>
        </ul>
      </div>
    </main>
  );
}

export default App;
